import React from "react";

function SignUpPage() {
    return (
        <div className="SignUpPage">
            <form>
                <label>
                id<input type="text" placeholder="아이디"/>
                </label>
                <label>
                비밀번호<input type="password" placeholder="비밀번호"/>
                </label>
                이메일 <input type="email" placeholder="이메일"/>
            </form>

        </div>
    )
}


export default SignUpPage;
